YF360D series is a versatile, easy-to-deploy, rugged and reliable VPN gateway designed for harsh environment, providing seamless, secure, fast wireless connectivity to M2M/IoT applications.


Dual SIM Industrial Cellular VPN Router with 4 Ethernet ports;

GPRS/EDGE/UMTS/HSPA/EVDO/4G LTE Networks;

Supports Centralized M2M management platform;

Supports GPS (optional), provides real time location/ tracking;

Supports 802.11 b/g/n Wi-Fi, AP and client mode.

Various interfaces: RS232/RS485/Console/Ethernet.

6 modos de entrenamiento: Cinta para correr, ejercicio, correr al aire libre, montar en bicicleta, caminar, nadar en la piscina;
contar los pasos, la distancia y las calorías quemadas. Monitoreo de la salud: Notificaciones de finalización del entrenamiento, establecimiento de metas, monitoreo del sueño, monitoreo de la frecuencia cardiaca, revisión de la frecuencia cardiaca durante todo el día, frecuencia cardiaca en reposo, tabla de frecuencia cardiaca y alertas de inactividad. Otras características: Alarma, sensor de proximidad, esfera del reloj preestablecida, esfera del reloj personalizable, pantalla de bloqueo, temporizador, cronómetro, alarma y notificaciones telefónicas, llamadas entrantes, notificaciones de mensajes, notificaciones de calendario, notificaciones de aplicaciones, pronóstico del tiempo, buscar mi teléfono, desbloquear el teléfono, notificación de eventos, modo nocturno, modo No molestar (funciona incluso sin teléfono), controles de música, transmisión por Bluetooth, visualización del nivel de la batería,
diferentes formas de llevarla y actualizaciones de OTA.
